import logo from './logo.svg';
import './pginicio.css';
import logo2 from './logo.png';

function pginicio() {
  return (
    <div className="pginicio">
        <header className="pginicio-header">
      


        <div className = " row ">

          <div className = "  col d-flex justify-content-start ">

            <img src= {logo2} style = {{width:170, height: 80}}></img>

          </div>

          <div className = "col d-flex justify-content-end ">
          <div className = "  me-4 mt-3 cont">
            contacto 
          </div>

          <div className = " me-4 mt-3  ini " >
            inicio
          </div>

          <div className = " me-5 mt-3  ini " >
            registro
          </div>

          </div>

          

        </div>


        </header>

        <body className = "bodyinicio">






        </body>

    </div>

    );
}

export default pginicio;
